import "../App.css";
const Header=()=>{
    return(
        <div className="header">
            <h1>Shortify</h1>
            <nav>
                <a href="#"><div className="circle" style={{backgroundColor:"red"}}></div>Home</a>
                <a href="#"><div className="circle" style={{backgroundColor:"lightGreen"}}></div>About us</a>
                <a href="#"><div className="circle" style={{backgroundColor:"turquoise"}}></div>Contact</a>
                <a href="#"><div className="circle" style={{backgroundColor:"yellow"}}></div>Pricing</a>
                <a href="#"><div className="circle" style={{backgroundColor:"red"}}></div>Features</a>
            </nav>
            <button>Click</button>
        </div>
    )
}
export default Header;
